import React from 'react';
import './Carousel.css'; // Create a CSS file for styling if needed


const Feature = ( content ) => {
  return (

      // {console.log(content)}
      // <div className="col-9 col-4-medium">

          <section className="box feature">    

            {/* <div className="content"> */}
              <a href="#" className="image">
                <img src={content.content.pic} alt="" className="featureImg" />
              </a>
              <header>
                <h2> {content.content.address} </h2>
                <p>{content.content.price}</p>
              </header>
              <p>{content.content.description}</p>
            {/* </div> */}

          </section>
      // </div>
  );
};

export default Feature;
